import React from 'react';
import './index.scss';

import { toogleComplead } from '../redux/todo/todoSlice';
import { useDispatch, removeTask } from 'react-redux';


export default function TodoTask( {todo} ) {
    const dispatch = useDispatch();

    const toogleCompleadId = (id) => {
        dispatch(toogleComplead(id))
    }
    const deleteTask = (id) => {
        dispatch(removeTask(id))
    }
    return (
        <div className='task'>
            <button onClick={() => toogleCompleadId(todo.id)}>complead</button>
            <p className={todo.complead ? 'complead' : ''}>{todo.text}</p>
            <button>remove</button>
        </div>
    )
}
